import{_ as e,c as t,o as r,ag as l}from"./chunks/framework.BgId8OS5.js";const p=JSON.parse('{"title":"切换更新通道","description":"","frontmatter":{},"headers":[],"relativePath":"zhCN/lxguide/others/switch-channel.md","filePath":"zhCN/lxguide/others/switch-channel.md","lastUpdated":1750569799000}'),i={name:"zhCN/lxguide/others/switch-channel.md"};function o(n,a,s,h,c,u){return r(),t("div",null,a[0]||(a[0]=[l('<h1 id="切换更新通道" tabindex="-1">切换更新通道 <a class="header-anchor" href="#切换更新通道" aria-label="Permalink to &quot;切换更新通道&quot;">​</a></h1><p>LauncherX具备多个更新通道和发行分支。</p><div class="warning custom-block"><p class="custom-block-title">现在还不是时候…</p><p>截至目前（2025年2月9日），LauncherX现在实际存在差异的通道只有2条：Stable和Higgs。</p></div><nav class="table-of-contents"><ul><li><a href="#切换更新通道">切换更新通道</a><ul><li><a href="#更新通道">更新通道</a></li><li><a href="#如何切换">如何切换</a></li><li><a href="#获取内测权限">获取内测权限</a></li></ul></li></ul></nav><h2 id="更新通道" tabindex="-1">更新通道 <a class="header-anchor" href="#更新通道" aria-label="Permalink to &quot;更新通道&quot;">​</a></h2><p>LauncherX在设计时存在这些更新通道：</p><ul><li>Stable (Atom) - 最慢，最稳定，平均1到2个月更新一次。允许用户不登陆使用。</li><li>Proton - [<em>暂不可用</em>] 次慢，次稳定，平均每20天更新一次。必须登录使用，但是无需内测权限。</li><li>Neutrino - [<em>暂不可用</em>] 次快，不稳定，平均半个月更新一次。必须登录使用且需要内测权限。</li><li>Higgs - 最快，最不稳定，但是部署修复最快，高峰时期一天可能更新七八次。必须登录使用且需要内测权限。</li></ul><h2 id="如何切换" tabindex="-1">如何切换 <a class="header-anchor" href="#如何切换" aria-label="Permalink to &quot;如何切换&quot;">​</a></h2><p>从官网下载的即是当前最新版本的稳定版。在稳定版中登录日冕账户，即可在【设置-启动器账户-先导版本体验设置】选择 <strong>更新通道</strong> 和 <strong>发行分支</strong>。在选择后，点击保存即可获取对应渠道最新版本的LauncherX以供更新。如果提示失败，请确认自己有对应的权限。<a href="https://corona.studio/auth/login" target="_blank" rel="noreferrer">前往官网主站 登录到服务</a>即可查询，如果有【荣誉股东】标记则是有权限。</p><h2 id="获取内测权限" tabindex="-1">获取内测权限 <a class="header-anchor" href="#获取内测权限" aria-label="Permalink to &quot;获取内测权限&quot;">​</a></h2><p>LauncherX是一个以社区驱动为主的启动器，在启动核心、文档（CSKB）、语言本地化和资源翻译等领域接受来自社区的为爱发电。包括赞助在内，这些都是支持LauncherX及其他项目的表现，为此我们除了感激，只能报以在多方面与我们深入交流的<strong>内测权限</strong>等特别权利。这些接受贡献的项目由我们一起构建，我们一起将这些美观实用的趁手工具带到现实之中，感谢社区中每一位热心市民的贡献。</p><p>以下是可以获取内侧权限的方法（均需要登录状态正常的CSA日冕账户，可能需要提供账户对应邮箱）：</p><ul><li>在LauncherX资源纠正计划 /「简明资源信息数据库」计划中累计成功贡献50次（提交50次通过审核的有效贡献），即可联系我们获取内测权限。</li><li>在我们的任意公开多语言仓库中贡献，维护完整的至少一门语言，即可联系我们，提供自己的日冕账户邮箱以获取内测权限。</li><li>向我们的公开项目仓库提交有效的Pull Request，在我们接受后即可联系我们获取内测权限。</li><li>加入我们，和我们一起构建，可以获取内测权限。</li><li>在稳定版率先发现重要bug（即，<a href="https://www.minebbs.com/resources/launcherx.7182/updates" target="_blank" rel="noreferrer">MineBBS平台上的更新日志</a>中没有写在<strong>已知问题</strong>那一栏的问题）并反馈给我们并得到认可，即可索取内测权限。</li><li>向我们赞助任意可接受金额，即可获取内测权限（赞助需要登录到官网主站后通过<a href="https://corona.studio/user/sponsor" target="_blank" rel="noreferrer">赞助页面</a>来完成。具体操作指引请参考：<a href="/zhCN/guide/general/donate.html">赞助我们！</a>）</li><li>其他被我们认定是贡献行为的，我们会主动联系您以开通内测权限。<b class="red bold">  谨防诈骗！</b></li></ul><div class="warning custom-block"><p class="custom-block-title">意外</p><p>很遗憾，目前（2025年2月10日）由于我们的服务器部署在海外，被支付平台屏蔽，所以<strong>我们不再接受微信/支付宝赞助</strong>。请直接通过爱发电和我们的官网进行赞助打赏和账户绑定，详见：<a href="/zhCN/guide/general/donate.html">赞助我们！| 如何绑定订单号 | CSKB</a></p><p>目前只有老腊肉有修改权限状态的能力。他可能与在中国大陆的各位存在时差。（2025年2月20日）</p></div><div class="danger custom-block"><p class="custom-block-title">谨防诈骗！</p><p><b class="red bold"></b> 我们主动联系您开通权限时不会向您索取任何转账或验证码等信息！谨防诈骗！目前仅有<strong>老腊肉</strong>和<strong>法棍</strong>可能会主动联系用户开通权限，如果遇到信不过的人以给予权限为由和您联系，截屏并前往 <a href="javascript:window.navigator.clipboard.writeText(&#39;589798569&#39;);alert(&#39;LauncherX交流群1的群号 589798569 已复制&#39;);">LauncherX交流群</a> 询问一下总是没错的。谨防诈骗！（相关阅读：<a href="/zhCN/geula.html#_3-免责声明">通用隐私政策和最终用户许可协议#免责声明 | 日冕知识库</a> # <a href="/zhCN/guide/contact.html">指路官方 | 日冕知识库</a> # <a href="/zhCN/guide/joinus.html">加入我们吧! | 日冕知识库</a> # <a href="/zhCN/guide/team.html">我们的团队 | 日冕知识库</a>）</p></div>',15)]))}const g=e(i,[["render",o]]);export{p as __pageData,g as default};
